;; **
;;; Gorilla REPL's plotting functions aren't as full-featured as those of dedicated graphics packages, but they can be handy. For example, here we  use `list-plot` and `compose` to plot the water levels of players over a game, which are stored in the `:global-history` of the game result:
;; **

;; @@
(let [ghist (:global-history (play-game
                               [(player "Wally" water-pf)
                                (player "Harry" water-hoarder-pf)
                                (player "Randy" random-pf)]))
      wally-waters (map :water (map #(get % "Wally") ghist))
      harry-waters (map :water (map #(get % "Harry") ghist))
      randy-waters (map :water (map #(get % "Randy") ghist))
      min-water (apply min (concat wally-waters harry-waters randy-waters))
      max-water (apply max (concat wally-waters harry-waters randy-waters))
      plot-fn (fn [data color]
                (plot/list-plot 
                  data 
                  :color color 
                  :joined true
                  :plot-range [:all [min-water max-water]]))]
  (plot/compose (plot-fn wally-waters "Blue")
                (plot-fn harry-waters "Red")
                (plot-fn randy-waters "Green")))
